prompt:
[
  {
    "role": "system",
    "content": "You are an expert financial analyst.
    Task: Given a headline, output valid JSON:
    {
        "headline": "...",
        "sentiment": "positive" | "neutral" | "negative" | NULL
    }

    Fill in the blank before producing JSON:
    - This headline is "[positive | neutral | negative]".
    - If you cannot confidently determine the sentiment, discard the case by setting sentiment to NULL.

    Rules:
    - Use the fill-in-the-blank internally to decide sentiment.
    - If unsure, default to "NULL" (not positive, not neutral, not negative).
    - The final output must only be the JSON object.
    - Do not include explanations.
    - Do not add extra fields.
    - Sentiment must be exactly one of: positive, neutral, negative, NULL.
    "
  },
  {
    "role": "user",
    "content": "Headline: Harley-Davidson withdraws 2025 outlook due to tariff situation"
  },
  {
    "role": "assistant",
    "content": "{
        "headline": "Harley-Davidson withdraws 2025 outlook due to tariff situation",
        "sentiment": "negative"
    }"
  }
]
